import chunk from "chunk"
import { LazyLoadImage } from 'react-lazy-load-image-component';

export default function Gallery(props) {
  return (
    <div className="flex">
    	{chunk(props.images.map(i => i.replace("public/", "")), Math.round(props.images.length/5)).map(
    		(column) => (
    			<div className="w-1/5">
    				{column.map(i => (
						<LazyLoadImage className="p-2" target={i.replace("thumb.", "")} src={i}/>
    				))}
    			</div>
    		)
    	)
		}
    </div>
  )
}
